script: |
  super -f text -I q11205.spq | sort > q11205.out

inputs:
  - name: q11205.spq
    data: |
      SELECT DISTINCT + + 99 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT NULL IS NOT NULL AND NOT 32 NOT BETWEEN + CAST ( + + col2 AS REAL ) + 33 AND - - col0;
  - name: tab2

outputs:
  - name: q11205.out
    data: |
